from typing import Any

def test_program(program: Any) -> None:
    # Test cases for different scenarios
    test_cases = [
        # Test case 1: Normal input
        {
            'input': 10,
            'expected_output': 100
        },
        # Test case 2: Edge case
        {
            'input': 0,
            'expected_output': 0
        },
        # Test case 3: Exceptional situation
        {
            'input': -5,
            'expected_output': -25
        }
    ]

    for i, test_case in enumerate(test_cases):
        input_data = test_case['input']
        expected_output = test_case['expected_output']

        # Run the program with the input data
        output = program(input_data)

        # Compare the output with the expected output
        if output == expected_output:
            print(f"Test case {i+1} passed")
        else:
            print(f"Test case {i+1} failed. Expected: {expected_output}, Actual: {output}")
```

To use this testing function, you can define your program as a callable function and pass it to the `test_program` function. The `test_program` function will execute the program with different test cases and compare the output with the expected output.
